s = ""
t = ""

lens = len(s)+1
lent = len(t)+1

print("lens:{},lent:{}".format(lens,lent))

prev = [0]*lent
cur = [0]*lent

for r in range(0,lens):
    #print("cur:{},prev:{}".format(cur,prev))    
    for c in range(0,lent):
        #print("\tr:{},c:{}".format(r,c))
        if r==0 and c==0:
            cur[c] = 0
        elif r!=0 and c==0:
            cur[c] = r
        elif r==0 and c!=0:
            cur[c] = c
        else:
            if s[r-1] == t[c-1]:
                cur[c] = prev[c-1]
            else:
                cur[c] = min(prev[c], prev[c-1], cur[c-1])+1
    prev = cur
    cur = [0]*lent
    
print("cur:{},prev:{}".format(cur,prev)) 
if prev[lent-1] == 1:
    print("True")
else:
    print("False")
            
